import React from 'react';
import styled from 'styled-components';

const FAQContainer = styled.div`
  padding: 2rem;
  text-align: center;
  background: #6D71D0;
  color: white;
`;

const Title = styled.h2`
  font-size: 2rem;
  margin-bottom: 1rem;
`;

const FAQItem = styled.div`
  margin: 1rem 0;
  font-size: 1.2rem;
  line-height: 1.6;
  max-width: 800px;
  margin: 0 auto;
`;

const FAQSection = () => {
  return (
    <FAQContainer>
      <Title>Frequently Asked Questions</Title>
      <FAQItem>
        <strong>Q: How does the app work?</strong>
        <p>A: The app uses AI to analyze your posture in real-time and provides actionable feedback.</p>
      </FAQItem>
      
    </FAQContainer>
  );
};

export default FAQSection;
